import React, {Component} from 'react';
import { Link } from 'react-router-dom';
import './gameMenu.css';

class GameMenu extends Component {
    render () {
        return (
            <div>
                {/* Quiz Link Section */}
                <Link
                    to=""
                    className="basic-btn quiz-btn"
                >
                    <h3>Quiz</h3>
                </Link>
                {/* End of Quiz Link Section */}

            </div>
        );
    }
}

export default GameMenu;
